import { connect } from "react-redux"
import PlaceDetails from "../PlaceDetails/PlaceDetails"
import "./list.css"
const List = ({place:{ places , loading}}) => {
    return (
        <div>
            <h4 className="left-title">Search for Restaurants, Places and Hotels around the glob</h4>
        </div>
    )
}

const mapStateToProps = state =>({
    place: state.place
})
export default connect(mapStateToProps,{})(List)
